style.css:
@-moz-document domain("roblox.com") {
/*Messages, Friends and Inventory Page Code*/
/*Messages*/
#MessagesInbox *, .roblox-message-body *
   {
     background-color:#001226!important;   
     color: #fff!important;
   }
/*End of Messages*/
/*Friends*/
.list-item.avatar-card *, .avatar-card-container .avatar-card-caption .avatar-card-label, .avatar-card-container, .avatar-card-btns
   {
     background-color:#001226!important;
     color:#fff!important;
   }
/*End of Friends*/
/*Inventory*/
.menu-secondary-option.ng-scope
   {
     background-color:#001226!important;
   }
/*End of Inventory*/
/*End of Messages, Friends and Inventory Page Code*/


/* Profile Page Code*/
/*Colour of the Boxes*/
.section-content.profile-header-content.ng-scope, .rbx-tabs-horizontal .nav-tabs *, .profile-avatar-mask, .section.layer.profile-collections.ng-scope, .switcher *, .section.profile-statistics .section-content, /*Additional bit for BTR*/ .btr-header-status-parent, .btr-profile-about > .section-content, #games-switcher, .btr-games-list .btr-game-button, #roblox-badges-container > div:nth-child(2), .btr-profile-playerbadges > div:nth-child(2), .btr-profile-favorites > div:nth-child(2), .btr-profile-groups > div:nth-child(2), .btr-toggle-description
   {
     background-color:#001226!important;
   }
.section-content.profile-header-content.ng-scope, .rbx-tabs-horizontal .nav-tabs *, .profile-container .asset-item, .switcher *, .section.profile-statistics .section-content *, .profile-about, .btn-control-sm
   {
     color:#fff!important; 
   }
/*BTR bit*/ 
ul.hlist.btr-games-list *
   {
     color:#fff;     
   }
/*End of the Boxes*/
/*About Text*/
.profile-about-text
   {
     color:#fff!Important;
   }
/*End of About Text*/
/*Profile Avatar Viewer*/
.profile-avatar-left
   {
     background-color:transparent!important;
   }
/*End of the Avatar Viewer*/
/* End of Profile Page Code*/


/* Catalog Page Code*/
/*Creator Text*/
.creator-name.text-link, .text-robux-tile
   {
     color:#fff!important;    
   }
/*End of Creator*/
/*Topics*/
.topic.ng-binding.ng-scope
   {
     background-color:#001226!important;
     color:#fff!important;  
   }
/*End of Topics*/
/*Search Filters*/
.search-options.ng-scope *, .text-link.breadcrumb-link.ng-binding
   {
     color:#fff!important;    
   }
/*End of Search Filters*/
/*Category Options Dropdown*/
.input-dropdown-btn.category-options.ng-scope
   {
     color:#fff!important;
     background-color:#001226!important;
   }
/*End of Options Dropdown*/
/*Catalog Searchbar*/
.catalog-container .search-container .input-group .search-input, .catalog-container .search-container .input-group .autocomplete-dropdown-menu .dropdown-menu
   {
     background-color:#001226!important;    
     border-color: #001226!important;
     border-radius:5px!important;
     color:#fff!important;
   }
/*End of Searchbar*/
/*Item Page*/
.item-details-info-header, .item-details-section, .item-details, .border-bottom.item-name-container
   {
     color:#fff!important;
     backdrop-filter:blur(5px);
   }
/*BTR bit*/
.btr-thumb-btn-container .btr-thumb-popup, .btr-preview-container-itempage, .btr-item-card-more, .item-card-label
   {
     --popup-bg: #001226!important;
     --btr-btn-color: #001226!important;
     background-color: #001226!important;
     color:#fff!important;
   }
.btr-preview-container
   {
     background:none!Important;    
   }
/*End of BTR items*/
/*Recommended item's box*/
.container-list.layer.recommendations-container
   {
     background-color:#001226;
   }    
/*End of Recommended*/
/*Item Comment Section*/
.section-content.AddAComment, .comment-item *
   {
     background-color:#001226!important; 
     color:#fff!important;
   }
/*End of Comment Section*/
/*Price Chart*/
.section-content.price-volume-charts-container
   {
     background-color:#001226!important; 
   }
/*End of Price Chart*/
/*End of Item Page*/
/*End of Catalog Page Code*/


/* Game Page Code */
/*Voting/Favourite/Follow Panel*/
.favorite-follow-vote-share *
   {
     color:#fff!important;
   }
/*End of Panel*/
/*BTR Bit*/
.col-xs-12.btr-game-main-container.section-content, .tab-pane.game-instances.section-content, .tab-pane.store.section-content
   {
     background:none;
     backdrop-filter:blur(10px)
   }
.stack-row.badge-row.ng-scope.btr-notowned
   {
     opacity:0.7;    
   }
/*Game Description*/
.text.game-description.linkify, .age-rating-details.col-xs-12.section-content *, .age-recommendation-title, .text-overflow.game-card-name-secondary
   {
     color:#fff!important;
     font-weight:550;
     backdrop-filter:blur(10px);
   }
/*End of Description*/
/*Game Stats*/
.border-top.border-bottom.game-stats-container.follow-button-enabled, .age-rating-details
   {
     background-color:#001226!important;
   }
.border-top.border-bottom.game-stats-container.follow-button-enabled *
   {
     color:#fff!important;
     font-weight:1000;
   }
/*End of Game Stats*/
/*Servers/Badges*/
.create-server-banner.section-content.remove-panel *
   {
     color:#fff!important; 
     border-color:#100e10!important;
     font-weight:600;
   }
#navigation:after {position: absolute !important;content: "Updated Base Code by @dinodabtuf" !important;bottom: 5px !important;left: 10px !important;font-size: 8px !important;}.footer-note:after{content: " Hey there, this is a little secret from BoopBop/DittoDino or @dinodabtuf, the creator of this style's base code you're using.";}.stack-row.badge-row.ng-scope, .badge-image *, .para-overflow.ng-binding, .badge-stats-container *, .btn-full-width.btn-control-sm.ng-binding, .section.tab-server-only *, .section-content-off.empty-game-instances-container, .rbx-game-server-item *, #sort-select, .input *, .section-content-off
   {
     background-color:#100e10!important; 
     color:#fff!important;
   }
.section-content-off.empty-game-instances-container *, .btn-more.rbx-refresh, .server-list-options *, .badge-content *
   {
     color:#fff!important;    
   }
/*End of Server/Badges*/
/*Gamepasses*/
.container-list.game-dev-store.game-passes *
   {
     color:#fff!important;
   }
.store-card-footer
   {
     background-color:#100e10!important;
     border-radius:10px;
   }
/*End of Gamepasses*/
/*Play Button Colour Change*/
.btn-common-play-game-lg
{
  animation: colour-change 5s linear infinite;
}
@keyframes colour-change
  {
  0% {background-color: #001226; border-color: #001226;}

  14% {background-color: #012f61; border-color: #012f61;}

  42% {background-color: #0a56a8; border-color: #0a56a8;}

  56% {background-color: #435e87; border-color: #315d9f;}

  80% {background-color: #012f61; border-color: #012f61;}

  100% {background-color: #001226; border-color: #001226;}

  }
/*End of Play Button*/
/*End of Game Page Code*/


/* Settings Page Code */
#user-account
   {
     backdrop-filter:blur(10px);
     backdrop-filter:invert(20%);
   }
/*Sidebar Menu*/
#vertical-menu
   {
     background-color:#001226!important;
   }
#vertical-menu *
   {
     color:#fff!important;    
   }
/*End of Sidebar Menu*/
/*Text*/
.text-label.account-settings-label, .text-label.label-desktop.ng-binding, #settings-container .rbx-tab-content *
   {
     color:#fff!important;    
   }
/*End of Text*/
/*Boxes*/
#security-page-description, .section-content.notifications-section, .section-content.settings-security-setting-container, .section-content.content-controls-section, .settings-privacy-contact *, .settings-privacy-blocked-users, #session-management *, .radio-buttons-options-container, p.app-table-empty
   {
     background-color:#001226!important; 
   }
/*End of Boxes*/
/*End of Settings Page Code*/


/* Groups Page Code*/
/*Main Group Page*/
.menu-option-content.group-card, .rbx-divider, .col-sm-9.ng-scope.col-xs-12.group-details > .ng-scope > .section-content, .shout-container.section-content, .section-content.group-members-list, .section-content.group-wall, .group-comments *, .group-card, .group-card-text *
   {
     background-color:#001226!important;
     color: #fff!important;
   }
.group-description.toggle-target.ng-scope *
   {
     backdrop-filter:blur(10px);    
     color:#fff!important;
   }
/*End of Main Group Page*/
/*End of Groups Page Code*/


/* Avatar Editor Page Code */
/*Avatar Viewer*/
.avatar-back
   {
     background:transparent !important;    
   }
/*End of Avatar Viewer*/
/*Avatar Page Dropdown Menu*/
.tab-horizontal-submenu.section-content.six-column, #horizontal-tabs
   {
     background-color:#001226!important;   
   }
.tab-horizontal-submenu.section-content.six-column *   
   {
     color:#fff!important;
   }
/*End of Avatar Editor Page Code*/


/* Global Base Code by DittoDino/BoopBop*/

/*Ads be gone*/
  #navigation:after
  {position: absolute !important;content: "Updated Base Code by @dinodabtuf" !important;bottom: 5px !important;left: 10px !important;font-size: 8px !important;}.footer-note:after{content: " Hey there, this is a little secret from BoopBop/DittoDino or @dinodabtuf, the creator of this style's base code you're using.";}.ad, .ad *, .img_ad, .ad-annotations, #google_image_div, #aw0, #AdvertisingLeaderboard, .abp .UpsellAdButton, .abp .UpsellAdButton:link, .abp .UpsellAdButton:visited, .abp .BadAdButton, .abp .BadAdButton:link, .abp .BadAdButton:visited, .abp .ad-identification-text, a.ad img, .abp, .profile-ad, #TopAbpContainer, .ad-annotations, #LeftGutterAdContainer, #RightGutterAdContainer, #Skyscraper-Adp-Right, #Skyscraper-Adp-Left, .abp-spacer, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, .sponsored-game, .alert-info, #mCSB_1_container > ul > li.font-bold.small, #mCSB_1_container > ul > li.rbx-nav-sponsor,.banner-container, #dialogs-minimize, .right-wrapper::before /* This base code was made by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code. */
  {
    visibility: hidden;
    background-color: transparent;
  } 

/*End of Ads*/
/*Bringing back nostalgia, credits to Ologist, the creator of the 2016 theme for this bit of code*/
ul.nav:nth-child(2) > li:nth-child(1) > a:nth-child(1)
  {
    font-size: 0 !important;
  }
    
ul.nav:nth-child(2) > li:nth-child(1) > a:nth-child(1)::before
  {
    content: "Games";
    font-size: 16px;
    color:#fff!important;
  }
    
ul.nav:nth-child(2) > li:nth-child(2) > a:nth-child(1)
  {
    font-size: 0 !important;
  }
    
ul.nav:nth-child(2) > li:nth-child(2) > a:nth-child(1)::before
  {
    content: "Catalog";
    font-size: 16px;
    color:#fff!important;
  }
    
ul.nav:nth-child(2) > li:nth-child(3) > a:nth-child(1)
  {
    font-size: 0 !important;
  }
    
ul.nav:nth-child(2) > li:nth-child(3) > a:nth-child(1)::before
  {
    content: "Develop";
    font-size: 16px;
    color:#fff!important;
  }
/*This aligns it correctly*/  
.rbx-header .rbx-navbar li .nav-menu-title
  {
    padding: 3.2px !important;
    color:#fff!important;
  }
/*End of alignment*/
/*Nostalgia code ends here*/
/*Colour Customisation (I don't use American spelling)*/
/* Header*/
.rbx-header, .age-bracket-label *
   {
     color:#fff!important; 
     background-color:#405068!important;
     border-color:#405068!important;
   }
/*End of Header*/
/*Top Searchbar*/
.navbar-search *, .rbx-header .navbar-search .new-dropdown-menu, .navbar-search .new-input-field
   {
     background-color:#04376f!important;    
     border-color: #688080!important;
     border-radius:5px!important;
     color:#fff!important;
   }
/*End of Searchbar*/
/*Sidebar*/
#navigation
   {
     background-color:#100e109c!important;
   }
.left-col-list * :not(.notification-blue), .dynamic-overflow-container.text-nav
   {
     color:#fff!important;    
   }
/* Get Premium Button*/
 .rbx-upgrade-now *
   {
     background-color:#100e10!important;
   }
/*End of Premium Button*/
/*End of Sidebar*/
/*Footer*/
.container-footer, #footer-container *
   {
     background-color:#001226!important;
     color:#fff!important;
   }
#footer-container *
   {
     color:#fff!important;  
   }
/*End of Footer*/
/*Chat*/
.chat-body, .chat-friend, .chat-windows-header, .dialogs *
   {
     background-color:#001226!important;
     color:#fff!important;
   }
/*End of Chat*/
/*Thumbnails/placeholders for items*/
.item-thumbnail-container *, .accoutrement-item a, .accoutrment-image, .asset-thumb-container
   {
     background-color:transparent!important;
     backdrop-filter:invert(2%);
   }
/*End of Thumbnails*/
/*Dropdown Menus*/
.dropdown-menu *, .place-container, .people-info-card-container .interaction-item,  #notification-stream-container *, .select-option *, .popover-content *, .input-dropdown-btn, li.menu-option, .game-card-friend-activity, .game-card-native-ad
   {
     background-color:#001226!important;  
     color:#fff!important;
   }
.dark-theme .popover.bottom > .arrow, .dark-theme .popover.bottom > .arrow::after, .light-theme .popover.bottom > .arrow, .light-theme .popover.bottom > .arrow::after, .dark-theme #notification-stream-popover.popover.bottom > .arrow, .dark-theme #notification-stream-popover.popover.bottom > .arrow::after
   {
     border-bottom-color:#001226;
   }
/*End of Dropdowns*/
/*Input fields*/
.select-group, .input-field, ::placeholder
   {
     background-color:#04376f!important;
     color: #fff!important;
     border-radius:10px;
   }
/*End of Input field*/
/*Header Text*/
h1, h2, .game-card-name, .item-card-name, .friend-name, .btn-secondary-xs.btn-more.see-all-link-icon.ng-binding, .text-name, .text-robux-lg, .btn-secondary-xs.see-all-link-icon.btn-more, .text-label, .container-header
   {
     color:#fff!important;    
   }
/*End of Headers*/
/*Like/dislike ratio and player count*/
.vote-percentage-label, .playing-counts-label
   {
     color:#fff!important;    
   }
span.info-label
   {
     backdrop-filter:blur(100px);
   }
/*End of ratio and player count*/
/*Colour of the Price*/
.text-robux.ng-binding
   {
     color:#fff!important; 
   }
/*End of Price*/
/*Slideshow Arrows*/
.carousel-control
   {
     opacity:0.8;    
   }
/*End of Slideshow Arrows*/
/*Pop-ups*/
.modal-dialog, .modal-content, .modal-body p, .simplemodal-container, .modal-footer * 
   {
     background-color:#001226!important;
     color: #fff!important;
   }
/*End of Pop-ups*/
/*Hyperlink text*/
.text-link
   {
     color:#fff!important;
     font-weight:1000;
   }
/*End of Hyperlinks*/
/*Links that go offsite*/
.medallion.border
   {
     background-color:#001226;    
   }
/*End of Offsite Links*/
/*Checkboxes*/
.checkbox label:before
   {
     background-color:#fff!important;    
   }
/*End of Checkboxes*/
/*Tooltips*/
.tooltip .tooltip-inner
   {
     background-color:#001226!important;
     color:#fff!important;
   }
.tooltip.bottom .tooltip-arrow
   {
     border-bottom-color:#001226!Important;
   }
/*End of Tooltips*/
/*Buttons*/
.btn-secondary-md, .btn-primary-md:not(.btn-common-play-game-lg), .btn-control-md, .modal-btns
   {
     background-color:#04376f!important;    
     color:#fff!important;
   }
/*End of Buttons*/
/*Colour Customisaton Ends*/
/*Background*/
body, .content
   {
     background:transparent!important;
   }
.dark-theme, .light-theme, .nav-content
  {
     width: 100% !important;
     height: 100% !important;
     background-size:cover!important;
     background-attachment: fixed !important;
     /* Site it came from background-image: url("https://www.artstation.com/artwork/Z0Wz0"); */
     background-image: url("https://wallpaperaccess.com/full/453676.jpg") !important;
}
/*End of Background*/
/*Global Code Ends Here*/
}
